PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?univ ?univ_label ?color ?color_label WHERE {
  ?journal fb:type.object.key "/en/harvard_undergraduate_research_journal" .
  ?journal fb:book.periodical.publisher ?pubnode .
  ?pubnode fb:book.periodical_publisher_period.publisher ?univ .
  ?univ fb:education.educational_institution.colors ?color .
  OPTIONAL {
    ?univ rdfs:label ?univ_label .
  }
  OPTIONAL {
    ?color rdfs:label ?color_label .
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?place ?place_label ?gnis WHERE {
  fb:m.0dq9wx fb:people.person.places_lived ?pl .
  ?pl fb:people.place_lived.location ?place .
  OPTIONAL {
    ?place rdfs:label ?place_label .
    FILTER ( lang( ?place_label ) = "" || langMatches( lang( ?place_label ) , "en" ) )
  }
  ?place fb:location.location.gnis_feature_id ?gnis .
  FILTER ( xsd:integer ( ?gnis ) < 1662328 )
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?film ?film_label ?netid WHERE {
